import React from 'react'

const Card = () => {
  return (
    <div>
      <img alt='robots' src='https://robohash.org/jane-doe' />
      <div>
        <h2>Jane Doe</h2>
        <p>jane.doe@gmail.com</p>
      </div>
    </div>
  );
}
 
export default Card;
